import React from 'react';
import MUIDataTable from "mui-datatables";
import DeleteIcon from '@material-ui/icons/Delete';
import './App.css';

const data = [{
  "name": "Rock",
  "email": "rock@demo.com",
  "designation": "Software Developer",
},
{
  "name": "Jone",
  "email": "jone@demo.com",
  "designation": "Java Developer",
},
{
  "name": "Tom",
  "email": "Tom@demo.com",
  "designation": "Frontend Developer",
},
{
  "name": "Robert",
  "email": "robert@demo.com",
  "designation": "Backend Developer",
},
{
  "name": "Zac",
  "email": "zac@demo.com",
  "designation": "Ios Developer",
},
{
  "name": "David",
  "email": "david@demo.com",
  "designation": "Android Developer",
}]

const columns = [
  {
    name: "name",
    label: "Name",
    options: {
      filter: true,
      sort: true,
    }
  },
  {
    name: "email",
    label: "Email",
    options: {
      filter: true,
      sort: false,
    }
  },
  {
    name: "designation",
    label: "Designation",
    options: {
      filter: true,
      sort: false,
    }
  }];

const COL_NAME = { name: "name", options: { sort: true, filter: true } }
const COL_EMAIL = { name: "email", options: { sort: true, filter: true } }
const COL_DESIGNATION = { name: "designation", options: { sort: true, filter: true } }
const COL_ACTIONS = {
  name: "action", options: {
    sort: true, filter: true,
    customBodyRender: () => {

    }
  }
}

const tableColumns = () => [COL_NAME, COL_EMAIL, COL_DESIGNATION, COL_ACTIONS]

function App() {
  return (
    <div className="App">
      <h1>MUI Datatable with react</h1>
      <MUIDataTable
        title={"Employee List"}
        data={data}
        columns={tableColumns()}
      />
    </div>
  );
}

export default App;
